import { NavLink } from "react-router-dom"


function MainNavigation() {
  return (
    <div>
        <button><NavLink className={({isActive}) => isActive ? "active" : undefined} to="/">Home</NavLink></button>
        <button></button><NavLink className={({isActive}) => isActive ? "active" : undefined} to="/events">Events Page</NavLink>
        <NavLink className={({isActive}) => isActive ? "active" : undefined} to="/events/new">New Event</NavLink>
    </div>
  )
}

export default MainNavigation
